import Axios from "axios";
import React, { useState } from "react";

export default function Dashboard() {
    const [data, setData] = useState([]);

    Axios.post('http://localhost:4000/add-evaluacion-1',).then((response) => {
        setData(response.data);
    });

    return (
        <div>
            <h1>Tabla de Normas</h1>




            <div className="card">
                <img className="card-img-top" src="http://kosmoinclusion.cl/wp-content/uploads/2019/04/logo-kosmo-1.png" alt="Card image cap"/>
                <div clasclassNames ="card-body">
                <h5 className ="card-title">Card title</h5>
                <p className ="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <a href="#" className ="btn btn-primary">Go somewhere</a>
                </div>
            </div>



            <table className="alinear formulario">
                <thead>
                    <tr>
                        <th>Titulo</th>
                        <th>Descripcion</th>
                    </tr>
                </thead>
                {data.map((user) => (
                    // display a <div> element with the user.name and user.type
                    // parent element needs to have a unique key

                    <tbody key={user.id}>
                        <tr>
                            <td>{user.titulo}</td>
                            <td>{user.descripcion}</td>
                        </tr>
                    </tbody>
                ))}
            </table>
        </div>
    )
}
